bool alive = true;
pthread_mutex_t mutex = PTHREAD_MUTEX_INITIALIZER;
pthread_cond_t w = PTHREAD_COND_INITIALIZER;
pthread_cond_t r = PTHREAD_COND_INITIALIZER;

int readers = 0; 
int writers = 0; 
int waiting_writers = 0; 

void *reader(void *arg)
{
    int id, i;

    id = *(int *)arg;

    while (alive) {
        
    	pthread_mutex_lock(&mutex);
    	while (waiting_writers > 0){ 
    		pthread_cond_wait(&r, &mutex); // signal받으면, 뮤텍스락을 얻으러 대기할것. 
    	}
    	// 상호배타가 되어있음. (mutex락을 들고 왔으므로)
	// 안에서 하나가 실행되고 있으니까, 바깥에 있는 대기열에서 하나 부름.
    	readers++; 

       /* while (readers == 1){ 
    		pthread_cond_wait(&w, &mutex);
    	}*/
    	
    	pthread_mutex_unlock(&mutex);
	
        printf("<");
        for (i = 0; i < L0; ++i)
            printf("%c", 'A'+id);
        printf(">");
        
        
        pthread_mutex_lock(&mutex);
        readers--;
        
        if (readers == 0 && waiting_writers > 0){
        	pthread_cond_signal(&w); 
        }
        pthread_mutex_unlock(&mutex);

    }
    pthread_exit(NULL);
}

void *writer(void *arg)
{
    int id, i;
    struct timespec req;

    id = *(int *)arg;
    srand(time(NULL));

    while (alive) {
        
    	pthread_mutex_lock(&mutex);
    	
    	waiting_writers++;
   	while(readers > 0 || writers > 0){ 
   		pthread_cond_wait(&w, &mutex);
	}

	waiting_writers--;
	writers++;
	pthread_mutex_unlock(&mutex);
		 
        printf("\n");
        switch (id) {
            case 0:
                for (i = 0; i < L1; ++i)
                    printf("%s\n", img1[i]);
                break;
            case 1:
                for (i = 0; i < L2; ++i)
                    printf("%s\n", img2[i]);
                break;
            case 2:
                for (i = 0; i < L3; ++i)
                    printf("%s\n", img3[i]);
                break;
            case 3:
                for (i = 0; i < L4; ++i)
                    printf("%s\n", img4[i]);
                break;
            case 4:
                for (i = 0; i < L5; ++i)
                    printf("%s\n", img5[i]);
                break;
            default:
                ; 
        }
        
        pthread_mutex_lock(&mutex);
        writers--;

       
        if (waiting_writers > 0){ 
        	pthread_cond_signal(&w);
        } else{
        	pthread_cond_broadcast(&r);
        }

        pthread_mutex_unlock(&mutex);
        /* 
         * End Critical Section
         */

        req.tv_sec = 0;
        req.tv_nsec = rand() % SLEEPTIME;
        nanosleep(&req, NULL);
    }
    pthread_exit(NULL);
}


int main(void)
{
    int i;
    int rarg[NREAD], warg[NWRITE];
    pthread_t rthid[NREAD];
    pthread_t wthid[NWRITE];
    struct timespec req;

    /*
     * Create NREAD reader threads
     */
    for (i = 0; i < NREAD; ++i) {
        rarg[i] = i;
        if (pthread_create(rthid+i, NULL, reader, rarg+i) != 0) {
            fprintf(stderr, "pthread_create error\n");
            return -1;
        }
    }
    /* 
     * Create NWRITE writer threads
     */
    for (i = 0; i < NWRITE; ++i) {
        warg[i] = i;
        if (pthread_create(wthid+i, NULL, writer, warg+i) != 0) {
            fprintf(stderr, "pthread_create error\n");
            return -1;
        }
    }
    /* 
     * Wait for RUNTIME nanoseconds while the threads are working
     */
    req.tv_sec = 0;
    req.tv_nsec = RUNTIME;
    nanosleep(&req, NULL);
    /*
     * Now terminate all threads and leave
     */
    pthread_mutex_lock(&mutex);
    alive = false;
    pthread_cond_broadcast(&r);
    pthread_cond_broadcast(&w);
    pthread_mutex_unlock(&mutex);
    
    for (i = 0; i < NREAD; ++i)
        pthread_join(rthid[i], NULL);
    for (i = 0; i < NWRITE; ++i)
        pthread_join(wthid[i], NULL);
        
    pthread_mutex_destroy(&mutex);
    pthread_cond_destroy(&r);
    pthread_cond_destroy(&w);
    
    
    return 0;
}
